rule "ASA duration fix"
when
    has_field("vpn_session_duration") &&
    regex(pattern:"[0-9]+:[0-9]+:[0-9]+", value:to_string($message.vpn_session_duration)).matches == true
then
    let duration_split = split(pattern:":", value:to_string($message.vpn_session_duration));
    let long_duration = to_long(duration_split[0])*3600 + to_long(duration_split[1])*60 + to_long(duration_split[2]);
    set_field(field:"vpn_session_duration", value:long_duration);
end
